update dataset set id = 9, submitter_id = 8, image_id = 9, identifier = '10.5524/100027', title = 'Genome data from the Tibetan antelope (<em>Pantholops hodgsonii</em>). ', description = 'The Tibetan antelope (<em>Pantholops hodgsonii</em>) is a native of the high mountain steppes and semi-desert areas of the Tibetan plateau.  It is a medium sized antelope that displays both migratory and herd behavior.  Of interest, it is the only member of the genus <em>Pantholops</em>.  The Tibetan antelope are listed as an endangered species, which is due to commercial poaching for their fine underwool, competition with local domesticated herds, and commercial development of their range land.

The genome of the Tibetan antelope was sequenced using Illumina GA sequencing technology.  Genome assembly and annotation was also completed.  The data here can be used for understanding the unique adaptations this animal has for surviving in its extreme high-altitude and as a model for investigating specific genetic mechanisms and the biology of other ruminant species.', dataset_size = 656056254464, ftp_site = 'ftp://climb.genomics.cn/pub/10.5524/100001_101000/100027/', upload_status = 'Published', excelfile = 'GigaDBUploadForm_Antelope.xls', excelfile_md5 = '9b301200c8ef05d1f756e7531eb0aed1', publication_date = '2011/11/12', modification_date = null, publisher_id = 1  where id = 9 ; 
